def getrupiah(price):
    try:
        temp = int(price)
        positif = False
        if temp > -1:
            positif = True

        temp = str(temp)
        temp = temp.split('-')[len(temp.split('-'))-1]
        pj = len(str(temp.split('.')[0]))
        pj_all = len(str(temp.replace('.','')))
        priceshow = ""
        index = 0
        for i in range(int(pj)):
            if (pj - index) % 3 == 0 and index != 0:
                priceshow += ','
            if not index >= pj:
                priceshow += temp[index:index+1]
            index += 1

        if len(temp.split('.')) == 2:
            index = pj
            for i in range(int(pj)):
                if index >= pj_all:
                    priceshow += temp[index:index+1]
                index += 1

        if positif == False:
            priceshow = '-' + priceshow
        return priceshow
    except:
        return price